import styled from 'styled-components'

export const LayoutLP = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`

export const LPTop = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-around;
  background: white;
  width: 100%;
  height: 60px;
  position: fixed;
  top: 30px;
`
